import React from 'react'
import data from '../data.json' ;
import "boo"


 function Product() {
     
  return (
    <div>
        {
            data.map((datum)=>{
                // const {name, image, descpription} = props ;
                return(
                    <div className="container bg-light p-2 m-2 d-flex justify-content-around">
                        <h3>{datum.name}</h3>
                        <img src={datum.image} />
                        <h4>{datum.descpription}</h4>
                    </div>
                )
            })
        }
    </div>
  )
}

export default Product ;
